import React from 'react';
import Pill from '../pill/pill.component'
import './player-options.styles.scss';
import { CardList } from "../card-list/card-list.component";
import {SearchBox} from "../search-box/search-box.component.jsx";

export const PlayerOptions = ({filteredPlayers, addPlayer, positions, positionSelected, handlePositionChange, handleChange}) => {
    <div className="player-options">

    <div className = 'player-options-top'>
     <Pill items={positions} selectedItem={positionSelected} handlePositionChange={handlePositionChange}/>
     <SearchBox
     placeholder="Search Player"
     handleChange={handleChange}
   />
   </div>
     <CardList players={filteredPlayers} addPlayer={addPlayer} />
   </div>
}
